import React from 'react'

function Boat(props){
    function handleClick(e){
        e.stopPropagation()
        props.callback(props.name)

    }
    return(
        <div onClick={handleClick} className={props.selected ? "boat selected" : "boat"}>
            <p>{props.name}</p>
            <p>{props.class}</p>
        </div>
    )
}

export default Boat
